import React from 'react'
import '../styles/TaskLists.css'
import AddTask from './AddTask'

function TaskLists({token, user}) {
  return (
    <div className='tasksListContainer'>
      <AddTask token={token} user={user}/>
    </div>
  )
}

export default TaskLists
